import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import NavbarComp from './component/navigation/NavbarComp';
import Home from './pages/Home';

function App() {
  return (
    <div>
      <div className="App">
        <NavbarComp/>
      </div>  
      <Home/>
    </div>

  );
}

export default App;
